$reduce and $setUnion for nested arrays in MongoDB<p>I am looking to merge nested arrays using $reduce and $setUnion in MongoDB. Following is the sample input -</p>

<pre><code>levels: [
 [[80,100,120]],[[100,150]],[[200,80,100]],[[80,100]]
]
</code></pre>

<p>The output what I am intended to get (i.e. merge nested arrays with unique values) -
levels: [80,100,120,150,100]</p>

<p>I am able to get the above output using two ways -</p>

<p>1) Using two $project stages in pipeline -</p>

<pre><code>aggregate([
$project: { levels : { $reduce: {
input: "$levels", initialValue: [], in:{$setUnion:["$$value","$$this"]}}}},
$project: { levels : { $reduce: {
input: "$levels", initialValue: [], in:{$setUnion:["$$value","$$this"]}}}}
])
</code></pre>

<p>2) First $unwind and then $project </p>

<pre><code>aggregate([
$unwind: { '$levels'}},
$project: { levels : { $reduce: {
input: "$levels", initialValue: [], in:{$setUnion:["$$value","$$this"]}}}}
])
</code></pre>

<p>Can there be any improved way of first option where I don't need to use the same $project twice? I am trying to avoid unwind.</p>

