            "weight" : NumberInt(26)
        }, 
        {
            "name" : "c", 
            "weight" : NumberInt(25)
        }, 
        ...
]
</code></pre>

<p>Each object in the array has keys <code>name</code> and <code>weight</code>. I need to remove the <code>weight</code> key, so that I'm just left with the <code>names</code> in an single-level array like <code>["a", "b", "c"...]</code></p>

<hr>

<p>An explanation of why I need to do this:</p>

<p>Inside my aggregation, I want to calculate the number of matches between an array <code>x = ["a", "b", "d"]</code> and whatever tags each document has.</p>

<p>This is as far as I've gotten- inside a <code>$project</code> I create a new variable like so:</p>

<pre><code>"$project": {
    ...
    "diff": {
       "$size": {
          "$setIntersection": [ x, "$tags" } ]
       }
    },
    ...
}
</code></pre>

<p>But of course this doesn't work as the <code>$tags</code> array is full of objects, and not strings. I need to strip the <code>weight</code> from the tags array and leave it just as an array of <code>names</code> like <code>["a", "b", "c" ...]</code>, then it should work.</p>

<p>How would I go about doing this?</p>

